{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Brine-Group-Staffing-Solutions-RVW15565575.htm', 'id': 15565575, 'currentJob': True, 'reviewDateTime': '2017-06-21 07:21:29.29', 'jobTitle': 'Intern - Hourly', 'location': 'Lowell, MA', 'jobTitleFromDb': 'Intern - Hourly', 'headline': 'New to the Industry', 'pros': "If culture is important to you, the Brine Group is a great place to be. Everyone is very kind, patient, and supportive--especially if you're new to the recruiting industry. Training has been a healthy balance of jumping right in and classroom style learning. They also have a great mission statement and clear set of goals. 

One of their objectives that I think sets them apart from the rest is that they work very hard to be more than your average recruiting agency, and truly value building great relationships with both their clients and their candidates.

Also, there are a lot of great amenities in the area--the Burlington Mall is across the street, you have access to a gym, cafe, and lots of other restaurants.", 'cons': "Depending on where you're commuting from, traffic can be a little heavy, but certainly not the worst I've seen.", 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Law-Offices-of-Bart-J-Carey-RVW12637875.htm', 'id': 12637875, 'currentJob': True, 'reviewDateTime': '2016-11-11 10:41:58.38', 'jobTitle': 'Paralgeal/Office Manager', 'location': 'Anaheim Hills, CA', 'jobTitleFromDb': 'Paralgeal/Office Manager', 'headline': 'Paralegal/Office Manager', 'pros': 'Who would have thought I would end up in my husband's line of business...divorces.  Family law was not something that I ever dreamed of.  But working in a practice with the goal of "A More Peaceful Divorce" changed my mind.  

If life has brought you to the place of divorce, this is the only way to go.   It's a non-court, non-adversarial, family-focused process.  It's divorce with the post-divorce family peace in mind.  

I love working with my husband, I love being part of this emerging practice of  family law and I love how my new career gives me the flexibility I need to concentrate on the most important things in life.', 'cons': 'Divorce is inevitable for some.  Hearing the stories of pain each day can be heartbreaking.', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Cogito-RVW29068679.htm', 'id': 29068679, 'currentJob': True, 'reviewDateTime': '2019-09-06 07:45:27.717', 'jobTitle': 'Director of Business Development', 'location': 'Boston, MA', 'jobTitleFromDb': 'Director of Business Development', 'headline': "It's a home away from home", 'pros': "Cogito is an exciting place to work - fast paced, bustling, industry firsts, largest enterprise customers - but it's also a nurturing place to work where leadership cares and advocates for you personally, at every turn.  

The Cogito culture is very much like a family - we laugh and have fun, we share meals and attend outings, we help each other through tough times and we work together to make the larger group/unit stronger, happier and more productive.

You can feel proud of any position you work in at Cogito.  Every employee is valued and considered a major contributor to the firm.", 'cons': 'Will update when I know of any', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Cook-CPA-Group-RVW26436036.htm', 'id': 26436036, 'currentJob': False, 'reviewDateTime': '2019-06-02 12:25:31.833', 'jobTitle': 'Staff Accountant', 'location': 'Roseville, CA', 'jobTitleFromDb': 'Staff Accountant', 'headline': 'Lack of Communication and training', 'pros': 'You get to work directly with clients and have a lot of responsibility.', 'cons': 'No upward mobility. One lady and maybe a part time senior. Pay is rock bottom and benefits are not good either. 

No real training. You are sat in front of a computer for a day listening to webinars online and are then told to go audit or work on a tax return with no real guidance. When you have a question, the partner tells you to go look it up because she has no idea. When you waste time looking it up she gets mad that it took you so long. There is no real knowledge base so it is frustrating. The partner also claims she is an expert in wine, equine, farm, and estate tax even though she has maybe one client in the field. 
This makes it impossible to really hone your craft.', 'overall': 1, 'overallNumeric': 1}

