{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Dyson-RVW30045049.htm', 'id': 30045049, 'currentJob': True, 'reviewDateTime': '2019-10-27 14:03:22.69', 'jobTitle': 'Employee', 'location': '', 'headline': 'A technology company as great as their products!', 'pros': 'Dyson is such a great company! If you’re expecting to walk in the door of a very structured, corporate company, you are wrong. The dress code is smart casual and the company functions like any tech start-up. It is still a privately held company.  It feels like a small company. There are not a lot of set processes. You don’t need to wait months to get a boards approval or sign off. The office is an agile, open floor plan. No one, regardless of title, has their own private, closed door office. 

Overall, the Chicago office is fairly small, about 300. I’ve had the opportunity to work with many teams not only in the US, but also Canada, Mexico, and even the UK.  You really have the ability to see your work have a meaningful, global impact.  I’ve also have had the opportunity to work on many side projects of things that interest me. If you raise your hand to volunteer on a project, most likely they will let you get involved in some way. The teams are also very collaborative and supportive. They truly live by the company mantra of “solve the problems others ignore”. If you’re stuck on something teammates and management are always willing to jump in to help. A team that works together succeeds together. 

Benefits package is good. There is a good work/ life balance. The products are truly amazing. I don’t know how I ever lived without an Air Purifier (it’s done wonders for my seasonal allergies) or an Airwrap (15 minutes to style and dry my hair, instead of 1.5 hours).  Employee discount and employee special sales are always a nice perk. When a new product is released, communications does a really great job planning activities for the office and there will usually be a contest for a free product. Employees also have the opportunity to participate in new product trials.  The company Christmas party is always so much fun too.  It is a huge costume party.  They determine a theme globally each year and there are prizes for the best dressed team.', 'cons': 'This is not a con for me, but it can be for some. Dyson can be very ambiguous and fast paced. Dyson is still a fairly young company, especially in the Americas. Dyson has only been in Mexico since about 2016. There are not a lot of processes in place.  Sometimes the information you need may not be available. No 2 days are the same. Things are constantly changing. If something is not working, we’re not going to continue to try doing things the same way. We will regroup and find a better way of doing things.', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Found-in-Translation-RVW8146217.htm', 'id': 8146217, 'currentJob': False, 'reviewDateTime': '2015-10-01 10:49:44.58', 'jobTitle': 'Employee', 'location': '', 'headline': 'Found in Exasperation', 'pros': 'Hands-down, this organization does incredible, valuable work, for highly deserving women. This was the most painful aspect of leaving the organization.', 'cons': 'The founder is also the executive director, and her complete lack of management skills will make you want to set your head on fire. Pushy, micromanaging on even the smallest of tasks, remarkably unhelpful and unaccountable when you actually do need her help, she sets great store by power dynamics. She feels the need to sabotage company projects, in order for her to visibly rescue them from supposedly inadequate staff. She will remind you constantly that "I did this job by myself for a long time," and that your position is big treat for which you should be endlessly grateful. In summary, the staff here serve as a punching bag for manager's internal issues around competence, dominance, alpha female-ness. Sigh.

The board consists of 2 or 3 yes-men that apparently never question the frequent resignations/letting go's or low morale of staff. 

This organization has extremely high turnover, precisely because no one can stand the executive director. May this review serve as a warning to other would-be do-gooders: take your skills, resources, and emotional energy elsewhere.', 'overall': 2, 'overallNumeric': 2}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-IBM-RVW30421712.htm', 'id': 30421712, 'currentJob': True, 'reviewDateTime': '2019-11-17 09:07:39.687', 'jobTitle': 'Research Scientist', 'location': 'Cambridge, MA', 'jobTitleFromDb': 'Research Scientist', 'headline': 'More inspiring directors are needed', 'pros': 'An opportunity to work with smart MIT faculty and students. Hope they say the same about us.', 'cons': 'The upper management is not inspiring - neither in Cambridge nor up to the top of IBM Research (a few are great though).

Folks with the title director know how to talk well, but I wish they were not here - they just bother us to do our work.

Sometimes press coming from the lab highlining "great" success is very inaccurate. There are no 100+ publications as published in Xconomy.', 'overall': 4, 'overallNumeric': 4}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Bill-Jacobs-Motorsport-RVW21799835.htm', 'id': 21799835, 'currentJob': True, 'reviewDateTime': '2018-08-03 13:53:27.007', 'jobTitle': 'Service Coordinator', 'location': 'Naperville, IL', 'jobTitleFromDb': 'Service Coordinator', 'headline': 'Best Job Ever!', 'pros': "This company is so awesome.  We get a really good base rate plus a commission.  We can give ourselves a raise every day by working hard and working smart.   There's tons of opportunity.

The department manager is always recognizing us for our effort and - if we collect five recognitions - we get a gift card.  We also have a new program called the Apex Award that gives us a party and gift card when we go above an beyond. That's inspiring.

The HR team is always there with their doors literally open if we have a question, problem, or (mostly) to collect our gift cards!  The service managers and advisors are great to work with, too.", 'cons': "We are a tight knit team and sometimes it's frustrating if someone isn't being a team player.", 'overall': 5, 'overallNumeric': 5}

