enjoy working in an environment that caters to your bill-making needs.', 'cons': "I think it's a very good place to work - the system could use upgrading?!", 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-The-PM-Group-Texas-RVW3995792.htm', 'id': 3995792, 'currentJob': False, 'reviewDateTime': '2014-04-03 11:54:50.607', 'jobTitle': 'Employee', 'location': '', 'headline': 'There’s a reason they are the leading advertising agency in the region.', 'pros': 'The PM Group knows how to hire and keep the best talent in the region.  They seek to hire only strong performers and very motivated, driven people. It’s a streamlined agency operation with highly skilled and dedicated people in all departments.  If you are ambitious, looking to work hard and grow your skills and career, it’s a great place to be and you will be promoted and rewarded.  If you are not, it’s not the place for you because you will quickly fall behind. Top management is smart and knows how to deliver results for their clients, to whom they are extremely loyal. 

The company rewards employees with unique perks, such as tickets, client trade, and paid time off between Christmas Eve and New Years.  Company benefits are good.

The office environment is excellent.  Most employees have individual offices, not cubicles.  They invest in technology and state of the art tools for employees.  They are not cheap when it comes to investing in the office decor, technology or their people.', 'cons': 'The pace is fast. You need to be flexible with your personal life as it’s not a 9 to 5 job. Employees are held to high standards and are accountable for results, which is not for everybody.  It’s a place for driven people and high-performers.', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Rapid7-RVW30085561.htm', 'id': 30085561, 'currentJob': False, 'reviewDateTime': '2019-10-29 13:44:47.877', 'jobTitle': 'Employee', 'location': 'Boston, MA', 'headline': 'LOVED working here', 'pros': "Wow, this was a fantastic company to work for. I was on the UX team and it just made my life heaven while I worked there. Really fostered learning opportunities, encouraged people to solve problems a little outside of their job boundaries, great work life balance, and (my team specifically) group support and interest in each other's lives. I have friends from R7 that will be my friends for life.", 'cons': "I left because of a prolonged communication issue. That seemed to be a general issue at R7, communication within teams and across companies / depts / layers. I know I was not the only person to leave over this. 

Also, I wanted to be promoted up the seniority ladder in my role but was, for the most part, not given a lot of instruction on how to do so. 

Also sometimes I felt like during all hands / town halls / big meetings, our exec board would give us the run around on the questions that were selected to be answered. Almost like they wanted to say, hey look we answered your question, but actually, we didn't.", 'overall': 4, 'overallNumeric': 4}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-RCG-Talent-Solutions-RVW30466064.htm', 'id': 30466064, 'currentJob': True, 'reviewDateTime': '2019-11-19 13:47:40.06', 'jobTitle': 'Director', 'location': '', 'jobTitleFromDb': 'Director', 'headline': 'Meaningful work and good people', 'pros': "The work is supporting organizations doing meaningful work. It's rewarding to be able to support them in finding the right people for their organizations. The work is different each week, which keeps things interesting and challenging. There has been consistent opportunity to take on new types of tasks or projects, and increasing responsibility. 

I genuinely enjoy my coworkers. Everyone brings unique experiences and personalities.

There can sometimes be ambiguity and often changing of directions which isn't for everyone, but if you enjoy that fast-paced, upstart environment it's a lot of fun.", 'cons': "All employees are remote, which means we don't get to see each in person often.", 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Sage-Goddess-RVW24999484.htm', 'id': 24999484, 'currentJob': False, 'reviewDateTime': '2019-03-05 06:12:11.823', 'jobTitle': 'Employee', 'location': '', 'headline': 'Be open to change', 'pros': 'One of the company’s best assets is the people who work here. From people on the production floor, to the showroom, to professionals, every department in the company is staffed with the most loving, fun, caring people. 

You also get to work with beautiful products and learn about properties of the various gemstones and crystals, herbs, and oils the company sells. And you get to enjoy a nice employee discount. If you’re into metaphysics and spirituality, you will also enjoy the free events and classes offered by the company’s owner.

As far as the work itself, you must stay open to the many changes that happen often, be flexible, and willing to jump in wherever and whenever you’re needed. It’s fast-paced and attention to detail is a must. Attitude is everything. If you can keep a positive attitude and don’t take things personally, you’ll have a good experience. You must also stay open for feedback, take responsibility for and ownership of your work, and be willing to execute tasks on the demand. Although this could be nerve-wrecking for some people, if you remain open and flexible, you can use this as an opportunity to learn, grow, and acquire knowledge and skills.', 'cons': 'If you’re looking for a company that offers the standard benefits, such as paid vacation, affordable health insurance, 401k, industry average pay, etc, this is not the company. At the time of this review, there is no paid vacation, paid holidays are minimal, and work-life balance can be very challenging, especially if you have a family.', 'overall': 4, 'overallNumeric': 4}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Siemens-PLM-Software-RVW30183136.htm', 'id': 30183136, 'currentJob': False, 'reviewDateTime': '2019-11-04 08:20:22.89', 'jobTitle': 'Software Engineer Co-Op', 'location': 'Milford, OH', 'jobTitleFromDb': 'Software Engineer Co-Op', 'headline': 'Working as a software engineering co-op', 'pros': 'Siemens PLM is a fantastic company. I worked there under the University of Cincinnati co-op program. My favorite aspect of this company is the work environment.

Everyone is friendly and inviting. I never had a bad interaction with an employee and it felt like everyone was there to help me learn as a student. 

The next best aspect was the workload. For the two semesters I worked there I was given the opportunity to work on small projects that helped me learn and understand their code architecture. I was given projects that kept me out of my comfort zone to help me learn and grow as a developer. Nothing was too easy or felt like I was not given the opportunity to learn.', 'cons': 'I did not experience any cons working at Siemens.', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Smartling-RVW29935557.htm', 'id': 29935557, 'currentJob': True, 'reviewDateTime': '2019-10-21 11:49:03.33', 'jobTitle': 'Senior Accountant', 'location': 'New York, NY', 'jobTitleFromDb': 'Senior Accountant', 'headline': 'Great company with amazing people', 'pros': "1.  Great company who cares its people so much, #1 core value is taking care of its people;
2.  Great work/life balance;
3.  More growth opportunities; 
4. This company has the most talented people;
5. A great, healthy and warm culture with so much benefits like unlimited PTO, bagel Monday's, company picnics, happy hours, group birthdays and fun events;", 'cons': 'I have nothing to report here!', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-OneVision-RVW4070785.htm', 'id': 4070785, 'currentJob': False, 'reviewDateTime': '2014-04-16 15:00:30.423', 'jobTitle': 'Solutions Engineer', 'location': '', 'jobTitleFromDb': 'Solutions Engineer', 'headline': 'I wish I had better things to say...', 'pros': 'Small company feel. Great sales team to work with. Industry standard software. Strong name recognition within the industry.', 'cons': "All decisions are dictated by the CEO/owner. Employees are often overruled and then criticized for not doing as he demands. However the customers can only be serviced by going around his archaic rules.

CEO instills culture where customers are treated like they 'should be thankful we are doing business with them'.

The company is tied as vendor to a shrinking industry, and haven't managed to find a new market for their product.", 'overall': 2, 'overallNumeric': 2}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-RIB-Software-RVW25298256.htm', 'id': 25298256, 'currentJob': False, 'reviewDateTime': '2019-03-22 12:15:14.56', 'jobTitle': 'Employee', 'location': '', 'headline': 'Vision is strong, execution is lacking', 'pros': 'Each of the regional teams has a strong mission-focused attitude, it was my experience that core team members would go out of their way to support one another in accomplishing goals.  U.S based leadership is knowledgeable, fair, and supportive to the extent that they can be which is why 3*.', 'cons': 'Platform greatly lags vision.  New features and functions are rolled out with any effective Quality Assurance creating the need for "work arounds", the software version of duct tape.  
Global leadership is the worst I've ever experienced in my career. There are unrealistic goals with extremely limited resources to accomplish them.  Global CEO will randomly berate employees in front of others.  Anyone can have a vision, execution is everything. 

Benefits are awful, pay was average.', 'overall': 3, 'overallNumeric': 3}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Staff-Finders-OR-RVW12548553.htm', 'id': 12548553, 'currentJob': True, 'reviewDateTime': '2016-11-03 12:39:44.313', 'jobTitle': 'Recruiter', 'location': 'Beaverton, OR', 'jobTitleFromDb': 'Recruiter', 'headline': 'Awesome Company', 'pros': 'The owner is very nice, professional, giving and the most understanding women I have met. She makes sure to take care of her employees. She has always worked with us in regards to days off, family emergencies, or adjusting to our needs. 

I have never worked for a better more ethical company in my career. 

I truly am blessed to be apart of such an amazing team and company.', 'cons': 'There are no cons to working with or at Staff Finders Technical.', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Stride-RVW30324736.htm', 'id': 30324736, 'currentJob': True, 'reviewDateTime': '2019-11-11 17:35:23.317', 'jobTitle': 'Client Success Manager', 'location': '', 'jobTitleFromDb': 'Client Success Manager', 'headline': 'Unique and innovative place to work', 'pros': "Stride is unlike any other place I have worked, specifically around the culture. Culture can be loosely defined as a way of life for a group of people--their values, behaviors, general way of thinking. Stride has a culture that promotes growth, empowerment, and transparency, all of the things that build strong individuals, while also building a strong team.

There is a good balance of working as a team and working quietly alone (which most of us accountants enjoy.) It can get lonely working from home alone, but I think it is what you make it. There is always someone willing to talk or collaborate if needed.

The team is a unique blend of accountants: being majority client facing and 100% remote; it isn't the company or role for just any accountant. I mean this as a positive aspect - Stride has a lot of amazing people who work there and they have made my time working there a real blessing.", 'cons': 'Super fast-paced environment. No day is ever the same and it seems like the day flies by.', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Stride-Consulting-RVW30423644.htm', 'id': 30423644, 'currentJob': True, 'reviewDateTime': '2019-11-17 12:42:59.49', 'jobTitle': 'Software Engineer', 'location': 'New York, NY', 'jobTitleFromDb': 'Software Engineer', 'headline': 'Great place to grow technically', 'pros': "Great company for improving technical skills. Stride sends devs to a large range of team types and technical problems, so if I want to learn a new language / framework / design pattern, even if it isn't relevant to my current client work, Stride gives time and incentives for me to do that.

I grow leadership / big picture organizational skills without having to take a manager path.  As a consultant I feel more empowered to help improve a team's processes and efficiencies. Stride invests in devs learning agile concepts and how to give feedback/guidance to a team's leadership.

I learn more here than I ever have. Striders are motivated to learn/get out of their comfort zone (switching clients means adapting to new environments). There is a diversity of expertise and people take the time to level each other up so we can all  bring top skills to any client situation.", 'cons': 'Stride tries to match devs with work that suits them, and gets feedback/moves people around, but there are no guarantees that every client you work with will be a perfect fit.', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-SUSE-RVW30358974.htm', 'id': 30358974, 'currentJob': True, 'reviewDateTime': '2019-11-13 07:03:40.15', 'jobTitle': 'Marketing', 'location': 'New York, NY', 'jobTitleFromDb': 'Marketing', 'headline': 'SUSE is a Great Place to Work with an Incredible Culture and Leadership Team', 'pros': 'SUSE is an incredible company, from the people and the welcoming culture to the leadership team that has a clear mission, vision, and strategy to achieve our growth targets. Never in my career have I worked for a company with passionate employees, a visionary leader and leadership team, and world-class innovations. 

The CEO is inspiring, cares passionately about women in technology, diversity and inclusion, and the people at the company. She is mission-driven and approachable leader, and unabashedly herself. 

Members of the leadership team are masters at their craft, passionate, and subject matter experts about their areas of the business. They do not sit in an ivory tower; they are approachable, and want to learn and engage with their teams. My line manager, is so knowledgeable about the business, empowers and supports me to make decisions, and provides constructive criticism when needed.', 'cons': 'SUSE is in the middle of a rapid business transformation. As such, the pace of change brings its own challenges. There are some who are resistant to change and others who are all in.', 'overall': 5, 'overallNumeric': 5}

{'attributionURL': 'https://www.glassdoor.com/Reviews/Employee-Review-Uber-RVW29548840.htm', 'id': 29548840, 'currentJob': True, 'reviewDateTime': '2019-10-01 05:33:22.07', 'jobTitle': 'Systems Engineer', 'location': 'Pittsburgh, PA', 'jobTitleFromDb': 'Systems Engineer', 'headline': 'On a Great Path Forward!', 'pros': "High standards, but high devotion as well. 

They're committed to my success as much as they are their own. And man...the workplace perks are a huge plus. Feels like I'm working towards a better future for myself and my city.", 'cons': "No 401k match. 

I get it, they want you to invest in the company, but I'd rather have more retirement than snacks and catered food. Probably a minority opinion but still notable.", 'overall': 5, 'overallNumeric': 5}

